export const AddCategory = ({setCategories}) => {

const[inputValue,setInputValue]=useState()

const handleInputChange= (e)=> {
  setInputValue(e.target.value)
}

const handleSubmit = (e) => {
  e.preventDefault();
  setCategories((cats) => [...cats, "hunter"])
}

    return (
        <>
        {/* <h1>{inputValue}</h1> */}
